import React, { useState } from 'react';
import {Box, Accordion, AccordionHeader, AccordionIcon, AccordionItem, AccordionPanel } from "@chakra-ui/core";
import './AdminMenu.css';

const AdminMenu = ({setView}) => {
    
    return (
        <div>
            <div className="menu">
                <Accordion allowToggle>
                    <AccordionItem>
                        <AccordionHeader _expanded={{ bg: "#38A169", color: "white" }}>
                        <Box flex="1" textAlign="left" onClick={()=>{
                            setView("GFR");
                        }}>
                            Generate Full Report
                        </Box>
                        </AccordionHeader>
                    </AccordionItem>
                    
                    <AccordionItem>
                        <AccordionHeader _expanded={{ bg: "#38A169", color: "white" }}>
                        <Box flex="1" textAlign="left" onClick={()=>{
                            setView("GSR");
                        }}>
                            Generate Section Report
                        </Box>
                        </AccordionHeader>
                    </AccordionItem>

                    <AccordionItem>
                        <AccordionHeader _expanded={{ bg: "#38A169", color: "white" }}>
                        <Box flex="1" textAlign="left" onClick={()=>{
                            setView("OM");
                        }}>
                            Student Outcome Mapping
                        </Box>
                        </AccordionHeader>
                    </AccordionItem>

                    <AccordionItem>
                        <AccordionHeader _expanded={{ bg: "#38A169", color: "white" }}>
                        <Box flex="1" textAlign="left">
                            Department Changes
                        </Box>
                        <AccordionIcon />
                        </AccordionHeader>
                        <AccordionPanel pb={4}>
                            <Accordion allowToggle>
                                <AccordionItem>
                                    <AccordionHeader _expanded={{ bg: "#38A169", color: "white" }}>
                                        <Box flex="1" textAlign="left" onClick={()=>{
                                            setView("CNS");
                                        }}>
                                            Create New Semester
                                        </Box>
                                    </AccordionHeader>
                                </AccordionItem>

                                <AccordionItem>
                                    <AccordionHeader _expanded={{ bg: "#38A169", color: "white" }}>
                                        <Box flex="1" textAlign="left" onClick={()=>{
                                            setView("EAC");
                                        }}>
                                            Edit Assigned Courses
                                        </Box>
                                    </AccordionHeader>
                                </AccordionItem>

                                <AccordionItem>
                                    <AccordionHeader _expanded={{ bg: "#38A169", color: "white" }}>
                                        <Box flex="1" textAlign="left" onClick={()=>{
                                            setView("EFL");
                                        }}>
                                            Edit Faculty List
                                        </Box>
                                    </AccordionHeader>
                                </AccordionItem>

                                <AccordionItem>
                                    <AccordionHeader _expanded={{ bg: "#38A169", color: "white" }}>
                                        <Box flex="1" textAlign="left" onClick={()=>{
                                            setView("EPL");
                                        }}>
                                            Edit Program List
                                        </Box>
                                    </AccordionHeader>
                                </AccordionItem>

                                <AccordionItem>
                                    <AccordionHeader _expanded={{ bg: "#38A169", color: "white" }}>
                                        <Box flex="1" textAlign="left" onClick={()=>{
                                            setView("ECL");
                                        }}>
                                            Edit Course List
                                        </Box>
                                    </AccordionHeader>
                                </AccordionItem>

                                <AccordionItem>
                                    <AccordionHeader _expanded={{ bg: "#38A169", color: "white" }}>
                                        <Box flex="1" textAlign="left" onClick={()=>{
                                            setView("ECO");
                                        }}>
                                            Edit Course Outcomes
                                        </Box>
                                    </AccordionHeader>
                                </AccordionItem>
                            </Accordion>
                        </AccordionPanel>
                    </AccordionItem>
                </Accordion>
            </div>

            {/* <div className="semester">
                <Box textAlign="center" bg="#38A169" color="white">
                    Current Semester:
                </Box>
                <Box textAlign="center" >
                    Fall 2020
                </Box>
            </div> */}

        </div>
    )

}
export default AdminMenu;
